INSERT INTO `posts` VALUES (1,3,'La violencia en el ftbol suele ser moneda corriente y el desvelo de muchos que desean erradicarla de una vez por todas. El clima de extrema competitividad que generalmente se genera, es donde muchos entrenadores, padres o familiares, viven con pasin desmedida el desarrollo de los partidos. En este caso, debemos serenarnos y trasmitirles a los nios que solo deben considerar al otro equipo como un rival dentro del campo de juego y concentrar nuestros esfuerzos en un futuro mejor para nuestros hijos. Desde nuestra Asociacin, levantamos la bandera de la importancia de un tercer tiempo, en donde todos los chicos puedan compartir y sepan que un espectculo deportivo, es un canal de expresin en donde podemos competir y anhelar ganar los partidos, pero deseando an con mayor fervor una sociedad ms justa y en paz.','Rivales deportivos, no enemigos',NULL,'2019-05-09 03:00:00','2019-06-08 14:23:01'),(2,3,'El 15 y 16 de septiembre del ao pasado, se llev a cabo en las instalaciones de F5, el 1 Torneo Regional de Baby Ftbol (categora 2006) denominado \"Franco Mayorga\". Este importante certamen deportivo, cont con la participacin de 20 equipos, no solo de la ciudad capital, sino tambin del interior de nuestra provincia. Cabe destacar, que fueron premiados con una medalla cada uno de los nios participantes, y claro est, tambin recibieron sus trofeos quienes se consagraron campeones tanto en la Copa de Oro, como la Copa de Plata, y los conjuntos que terminaron en 2, 3 y 4 puesto. Sin lugar a dudas, fue un evento de gran magnitud, que colm ampliamente las expectativas de los jugadores, entrenadores, publico en general, y los organizadores, la Asociacin Riojana de Baby Ftbol Infantil.','1 Regional de Baby Ftbol',NULL,'2019-05-09 03:00:00','2019-06-08 14:24:01'),(3,3,'Hace ms de 8 aos, Nicols Peralta, presidente de A.R.B.F.I, comenzaba a dar los primeros pasos con est asociacin para convertirse as en el pionero del Baby Ftbol en La Rioja. Desde esa poca y hasta la actualidad, trabaja incansablemente y con el mismo entusiasmo de siempre. Hace malabares para repartir su tiempo entre su familia, el trabajo y esta tarea que tanto lo apasiona, el ftbol infantil. Luego de una vasta trayectoria no solo como jugador en inferiores sino tambin como instructor de ftbol en el partido de 3 de Febrero (Bs. As.), destac con emocin que cuando retorne a mi provincia, decid continuar con mi pasin por este deporte, con el apoyo de mi familia y de mis hijos Ezequiel y Agustn, y este ltimo fue la razn que me llev a fundar esta fantstica liga en el 2011 y dar as el puntapi inicial. As que Nico, tal como la mayora lo conoce, desde nuestra lugar queremos felicitarte y a seguir adelante con ms fuerzas que nunca.','El pionero del Baby Ftbol',NULL,'2019-05-09 03:00:00','2019-06-08 14:24:50'),(4,3,'Cuando comienza a rodar una pelota por el campo de juego, detrs de ella se agolpan miles de ilusiones. En La Rioja, con el correr de los aos, se han multiplicado las escuelitas de ftbol, con el afn de brindarle a tantos nios un lugar de contencin y recreacin. Adems de entrenar, se transmiten valores como la constancia, el sacrificio, la disciplina, el espritu de superacin, el compaerismo, la solidaridad, entre tantas otras cosas. As mismo, no es ninguna novedad que en los clubes que participan del Baby ftbol, los entrenadores, delegados y padres reparten su tiempo entre sus actividades privadas y la colaboracin a la institucin donde sus pequeos hijos juegan, aprenden, y comparten. Por tal motivo, debemos dar el ejemplo de que el ftbol es un juego, en donde los nios puedan lograr vencer la presin y trabajar en equipo, en donde aprendan que los rivales son compaeros con quienes jugar y que lo mas importante es divertirse y no tan solo ganar.','El ftbol tambin educa y forma nios',NULL,'2019-05-09 03:00:00','2019-06-08 14:25:33'),(5,1,'El prximo fin de semana se pondr en marcha el segundo \"Torneo Regional\" con la participacin de delegaciones de nuestra ciudad que participan actualmente en nuestro formato y equipos invitados.\r\nEl sbado a partir de las 9:00 hrs en las instalaciones de F5 Evolushon y hasta las 15 hrs Baby Futbol La Rioja se pone en movimiento con el torneo homenaje a \"Franco Mayorga\", \r\nCopa de Oro 1ro al 4to\r\nCopa de Plata 1ro al 4to\r\nparticipacin para todos los jugadores.','Regional 2019',66,'2019-11-04 22:58:42','2019-11-04 22:58:42');
